import React from "react";
import { Link } from "react-router-dom";

function Ad_indv({ description, rent, ID }) {
  return (
    <div>
      Description:{description} Rent: {rent} ID: {ID}:
      <Link to="/rent">Rent</Link>
    </div>
  );
}

export default Ad_indv;
